(1, 1, 'CAOE01', 'COSECHA DE AGUA', 'cosecha-de-agua', 'En este curso “Cosecha de Agua hablaremos de la recolección del vital líquido derivado de las lluvias y otras fuentes para usarlo con fines productivos. Dado la escasez de agua en diversos lugares de nuestro país, un fenómeno que tiene un impacto negativo en la agricultura, es por ello importante subrayar que la falta de este recurso natural para el desarrollo de los cultivos conlleva a la búsqueda de múltiples soluciones, siendo la cosecha de agua una de las más efectiva.', 'Estudiantes y/o profesionales en ingeniería que deseen ampliar sus conocimientos. Público en general, profesionales que desean aprender sobre esta disciplina. ', 10.00, 24, 'plan_direccioneconomica.pdf', 700, 500, 'image/jpeg', , 1, '<!-- ./Tabs -->\r\n<p>&nbsp;</p>\r\n<div class=\"row\">\r\n<div class=\"section-title\">\r\n<h1 class=\"\">Temario</h1>\r\n</div>\r\n<div class=\"col-md-12\">\r\n<div id=\"accordion\" class=\"panel-group\">\r\n<div class=\"panel panel-default\">\r\n<div id=\"headingOne\" class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a href=\"#collapseOne\" data-toggle=\"collapse\" data-parent=\"#accordion\"> M&oacute;dulo 01</a></h4>\r\n</div>\r\n<div id=\"collapseOne\" class=\"panel-collapse collapse in\">\r\n<div class=\"panel-body\">\r\n<ul class=\"list\">\r\n<li>Estrategia financiera, econ&oacute;mica y sus impactos</li>\r\n<li>Estados financieros de las empresas constructoras y sus particularidadesfgxhxdfgxcbcxb</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div id=\"headingTwo\" class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a class=\"collapsed\" href=\"#collapseTwo\" data-toggle=\"collapse\" data-parent=\"#accordion\"> M&oacute;dulo 02 </a></h4>\r\n</div>\r\n<div id=\"collapseTwo\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<ul class=\"list\">\r\n<li>Planificaci&oacute;n financiera y formulaci&oacute;n de un plan</li>\r\n<li>Costos estrat&eacute;gicos y operativos para la creaci&oacute;n de valor</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div id=\"headingThree\" class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a class=\"collapsed\" href=\"#collapseThree\" data-toggle=\"collapse\" data-parent=\"#accordion\"> M&oacute;dulo 03 </a></h4>\r\n</div>\r\n<div id=\"collapseThree\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<ul class=\"list\">\r\n<li>Estrategias legales y tributarias en la industria constructora</li>\r\n<li>Financiamiento y endeudamiento en empresas constructoras</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div id=\"headingFour\" class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a class=\"collapsed\" href=\"#collapseFour\" data-toggle=\"collapse\" data-parent=\"#accordion\"> M&oacute;dulo 04 </a></h4>\r\n</div>\r\n<div id=\"collapseFour\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<ul class=\"list\">\r\n<li>Evaluaci&oacute;n econ&oacute;mica y financiera de un proyecto de construcci&oacute;n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"panel panel-default\">\r\n<div id=\"headingFive\" class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><a class=\"collapsed\" href=\"#collapseFive\" data-toggle=\"collapse\" data-parent=\"#accordion\"> M&oacute;dulo 05 </a></h4>\r\n</div>\r\n<div id=\"collapseFive\" class=\"panel-collapse collapse\">\r\n<div class=\"panel-body\">\r\n<h3>Evaluaci&oacute;n</h3>\r\n<p>&iquest;Est&aacute; preparado para rendir su evaluaci&oacute;n? Entonces puede iniciar</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'Acceso desde el primer día a nuestra aula virtual, material de estudio de primer nivel, profesores con amplia experiencia académica y talleres prácticos.', 'Nuestros docentes tienen amplia experiencia en el sector y están en permanente actualización y se encuentran acreditados por las mejores universidades del Perú.');
